           <Link path='/itinerary/23'>May 23</Link>
           <Link path='/itinerary/22'>May 24</Link>
           <Link path='/itinerary/23'>May 25</Link>
           <Link path='/itinerary/22'>May 26</Link>
           <Link path='/itinerary/23'>May 27</Link>
           <Link path='/itinerary/22'>May 28</Link>
           <Link path='/itinerary/23'>May 29</Link>
           <Link path='/itinerary/23'>May </Link>
        </div>
    )
};

export default ItinNav;
